import React, {Component} from 'react';
import PropTypes from 'prop-types';

import {connect} from 'react-redux';

class PresentedQuestions extends Component {
    render() {
        console.log(this.props);
        const questions = typeof this.props.questions === 'undefined' ? [] : this.props.questions;
        const presentedQuestions = questions.map(questionItem => (
            <div>
                <h3>{questionItem.question}</h3>
            </div>
        ));
        console.log(presentedQuestions);
        return (
            <div>
                <h3>Created questions</h3>
                {presentedQuestions}
            </div>
        );
    }
}

PresentedQuestions.propTypes = {
    questions: PropTypes.array.isRequired
};

// const mapStateToProps = (state) => ({
//     questions: state.inputtedQuestions
// });

const mapStateToProps = (state) => {
    console.log('mapStateToProps USAOOO');
    console.log(state);
    return {
        questions: state.inputtedQuestions
    };
};

export default connect(mapStateToProps, null)(PresentedQuestions);
